import React from "react";
import { Link } from 'react-router-dom'
import navlink from '../components/assets/Nav-link.png'
import footer from '../components/assets/footer_kasa.png'

function lodging () {
return ( 
    <div className="lodgingPage">
        <navlink />

        <footer>
                <img src={footer} alt ='footer site' className='footer-all' />
             </footer>

    </div>
)
 }
export default lodging;
